'use server'

import { UploadResult, ref, uploadString } from 'firebase/storage'
import { storage } from '@/lib/firebase/storage'

const TestUpload = () => {
  const pikachuRef = ref(storage, 'images/pikachu.png')
  const pikachubase64 = ``
  uploadString(pikachuRef, pikachubase64, 'base64').then(
    (snapshot: UploadResult) => {
      console.log(snapshot.metadata.timeCreated)
    },
    (error) => {
      console.log(error)
    }
  )
}

export { TestUpload }
